r - relevance;
ra - rating;
u - upload date;
v - view count;

Video features.  Available options(could be joined by ';'):
h - hdr;
hd - hd;
s - subtitles;
c - cc;
3d - 3d;
3 - 360;
li - live;
lo - location;
4 - 4k;

